import React from 'react';
import { Container, Row, Col } from "react-bootstrap";

const CreateTask = (props) => {
    return (
        <Container fluid>
            <Row>
                <Col>
                    <h1>Create a task</h1>
                </Col>
                <Col>
                    <button onClick={props.signOut}>Sign out</button>
                </Col>
            </Row>
            <Row>
                <Col><p>This will be the active area</p></Col>
            </Row>
        </Container>
    )
}

export default CreateTask;
